import React from "react";
import contactusvertical from "../../assets/images/contact-us-vertical.png"
const SocialFollow = () =>{
    return(
        <>
        <div className="contact-us-flag">
             <img src={contactusvertical} alt="contact-us-vertical"/>  
         </div>
        </>
    ) 
};
export default SocialFollow;
